import f1 from './images/fruits/tile000.png'

const fruit = [
    {id: 0, img: f1, alt: 'tile000'},
    {id: 1, src: './images/fruits/tile001.png', alt: 'tile001'},
    {id: 2, src: './images/fruits/tile002.png', alt: 'tile002'},
    {id: 3, src: './images/fruits/tile003.png', alt: 'tile003'},
    {id: 4, src: './images/fruits/tile004.png', alt: 'tile004'},
    {id: 5, src: './images/fruits/tile005.png', alt: 'tile005'},
    {id: 6, src: './images/fruits/tile006.png', alt: 'tile006'},
]

function imageLoader()
{
    return fruit;
}

export default imageLoader;
